■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">シマノ (SHIMANO)  16 スティーレ (Stile) ベイト(両軸)リール<br /><br /><br />ボートゲームの頂点は、スティーレで決める。<br /><br />釣り方の枠にとらわれず、その境界を越えろ。<br />洗練のフォルムで生まれた、かつてない、パワー、速さ、軽快さ。<br /><br />HAGANEボディとX-SHIPを搭載することで、金属製円形リールで培った安定したリーリングと、ロープロファイルボディのシャープなデザインに内蔵した軽さ、剛性、ホールド感を高品位に凝縮。バックラッシュの不安を解消する遠心力ブレーキシステムSVSも搭載。さらに、アングラーを熱狂させるエキサイティングドラグサウンドも採用しました。パワーギアのPG、エキストラハイギアのXGに加え新しくハイギアのHGもラインナップし、カワハギ、マルイカ、タチウオ、カレイなどはもちろん、メタルスッテ、鯛ラバ、ライトジギングまでも射程に入れたマルチユースモデルです。<br /><br />■エキサイティングドラグサウンド<br />ファイト中に魚がラインを引き出すとドラグ音が鳴る機構。魚の引きの強さを把握しやすく、勝負どころの判断を容易にしてくれるだけでなく、爽快なドラグ音がアングラーの気分を盛り上げ、ダイナミックなゲームを演出する。<br /><br />■X-SHIP<br />パワー伝達効率を向上させる<br /><br />ピニオンギアの両端をベアリングでがっちり支えてブレを極限まで抑えることにより、ギアフィーリングおよび強度、耐久性が大幅にアップ。ギアノイズも減少したことでリーリング時の感度に優れる。特にスローに誘う釣りでの威力は大きく、アタリを感じやすく釣果アップにつながる。<br /> <br />■ブレーキ搭載（SVS）<br />キャストして探る釣りに威力<br /><br />SVS(シマノバリアブルブレーキシステム)は、スプール回転の敏速な立ち上がりに優れる遠心力ブレーキ。キャストすることで、より広い範囲の攻略が可能となる。<br /><br />■発売年：2017年</font></td></tr></table><STYLE type="text/css">
